import React from 'react';
import ReactDOM from 'react-dom';

let Name = "Himanshu";
let LName = "Prajapati"


ReactDOM.render(

    <>
        <h1>My Name is {`${Name} ${LName}`}</h1>
        <h1>My Name is {Name + " " + LName}</h1>


    </>,
    document.getElementById('root')

);
